webpackJsonp([0xaf566e20d232],{590:function(e,t){e.exports={data:{markdownRemark:{html:'<p>You can download reports as .CSV files to enable you to quickly generate a spreadsheet of selected reports with key details. The .CSV files don\'t include the comments. The downloaded file provides the:</p>\n<ul>\n<li>Report ID</li>\n<li>Title</li>\n<li>Severity rating</li>\n<li>Severity score</li>\n<li>State</li>\n<li>Sub-state</li>\n<li>Weakness</li>\n<li>Time the report was reported</li>\n<li>Time of first response</li>\n<li>Time of triage time</li>\n<li>Time the report was closed</li>\n<li>Time the hacker was awarded with the award</li>\n<li>Security member assigned to the report</li>\n<li>Hacker that submitted the report</li>\n<li>Bounty </li>\n<li>Bonus</li>\n<li>Whether the report is public or private</li>\n<li>Reference</li>\n<li>Reference URL</li>\n<li>Structured scope</li>\n</ul>\n<p>To export reports as a .CSV file:</p>\n<ol>\n<li>Select the check box of the reports you\'d like to export in your inbox. You can select as many reports as you\'d like. </li>\n<li>Click the <strong>Download as CSV</strong> link that appears to download the selected reports. </li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-b3f6c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 41.391941391941394%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="export-reports"\n        title=""\n        src="/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-e7ffa.png"\n        srcset="/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-49813.png 125w,\n/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-dc8a5.png 250w,\n/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-e7ffa.png 500w,\n/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-dda24.png 750w,\n/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-c5f18.png 1000w,\n/static/export-reports-9c07db4450e139a6032ee25c2f41b2d7-b3f6c.png 1092w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/programs/export-reports.html",id:"programs/export-reports",title:"Export Reports",description:null}}},pathContext:{}}}});
